#Leetcode 2290
from heapq import heappush, heappop
from pprint import pprint

def minimumObstacles(grid):
    m = len(grid)
    n = len(grid[0])
    min_obstacles = [ [float("inf")]*n for _ in range(m) ]
    buffer = [(0, 0, 0)]
    flag=False

    while buffer:
        obs, x, y = heappop(buffer)
        if min_obstacles[x][y] > obs:
            min_obstacles[x][y] = obs
            if x < m-1 and obs+grid[x+1][y] < min_obstacles[x+1][y]: heappush(buffer, (obs+grid[x+1][y], x+1, y))
            if y < n-1 and obs+grid[x][y+1] < min_obstacles[x][y+1]: heappush(buffer, (obs+grid[x][y+1], x, y+1))
            if x > 0 and obs+grid[x-1][y] < min_obstacles[x-1][y]: heappush(buffer, (obs+grid[x-1][y], x-1, y ))
            if y > 0 and obs+grid[x][y-1] < min_obstacles[x][y-1]: heappush(buffer, (obs+grid[x][y-1], x, y-1))

    return min_obstacles[m-1][n-1]


